import React from "react";

function Header() {
  return (
    <div>
      <figure>
        <img
          src="/assets/logo.webp"
          srcSet="/assets/logo@2x.webp 2x , /assets/logo@3x.webp 3x"
          alt="김과장컨설팅"
        />
      </figure>
    </div>
  );
}

export default Header;
